import React from 'react';
import '../../App.css';
import Navbar from './Elements/Navbar.js';
import HelloSection from './Elements/HelloSection.js';
import Cards from './Elements/Cards.js';
import Footer from '../Footer.js';

function MainPage() {
  return (
    <>
      <Navbar />
      <HelloSection />
      <Cards/>
      <Footer/>
    </>
  );
}

export default MainPage;
